insert  into `sysconfigs`(`id`,`value`) values ('info_picture','http://'),('siteClosed','1'),('info','<center>\r\n<a style=\"FONT-size:24px\">科技教师培训报名</A>\r\n<div style=\"color:blue\"> </div>\r\n</center>\r\n<div>\r\n未注册的老师请注册一个新用户！<br />\r\n注册好后您的帐号永久有效，下次培训报名时无须再次注册！<br>'),('siteCloseTime','2015-01-28 12:00:00'),('totalLimit','0');

/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(20) NOT NULL,
  `password` varchar(100) NOT NULL,
  `school_id` int(11) NOT NULL,
  `sex` varchar(10) NOT NULL,
  `sfz` varchar(18) NOT NULL,
  `tel` varchar(11) NOT NULL,
  `email` varchar(100) NOT NULL,
  `address` varchar(255) NOT NULL,
  `isadmin` enum('0','1') NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `sfz` (`sfz`),
  KEY `school_id` (`school_id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=341 DEFAULT CHARSET=utf8;

